import React, { Component, Fragment } from 'react';
import { ValueConsumer } from '../../../Context';
import ItemImg from '../../atoms/main/ItemImg';
import BillItemName from '../../atoms/main/BillItemName';
import BillItemPrice from '../../atoms/main/BillItemPrice';
import './billItem.scss';

export class BillItem extends Component {

    render() {
        return (
            <ValueConsumer>{value =>
                value.items.map((item, index) => {
                    if (item.count > 0) {
                        return <div className='billItem'>
                            <ItemImg src={item.src} />
                            <div className='billItemDetail'>
                                <BillItemName name={item.name} weight={item.weight} />
                                <BillItemPrice oldPrice={item.old_price} newPrice={item.new_price} />
                            </div>
                        </div>
                    }
                })
            }
            </ValueConsumer>
        )
    }
}

export default BillItem
